import ExpenseItem from "./components/ExpenseItem";

function App() {
  const data = [
    {
      title: "Rent",
      date: new Date(2021, 9, 12),
      price: "Rs. 8000",
    },
    {
      title: "Maintenance",
      date: new Date(2021, 10, 13),
      price: "Rs. 4500",
    },
    {
      title: "Electricity",
      date: new Date(2021, 11, 15),
      price: "Rs. 2000",
    },
    {
      title: "Miscellaneous",
      date: new Date(2021, 9, 28),
      price: "Rs. 12000",
    },
  ];
  return (
    <div>
      <ExpenseItem
        title={data[0].title}
        date={data[0].date}
        price={data[0].price}
      />
      <ExpenseItem
        title={data[1].title}
        date={data[1].date}
        price={data[1].price}
      />
      <ExpenseItem
        title={data[2].title}
        date={data[2].date}
        price={data[2].price}
      />
      <ExpenseItem
        title={data[3].title}
        date={data[3].date}
        price={data[3].price}
      />
    </div>
  );
}

export default App;
